import React from 'react';

function TestComponent() {
  console.log('TestComponent rendered');

  return (
    <div style={{
      minHeight: '100vh',
      background: '#f5f1ec',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      flexDirection: 'column',
      gap: '1rem'
    }}>
      <h1 style={{ color: '#3c4c73' }}>Test Component Working!</h1>
      <p style={{ color: '#7e5a75' }}>If you see this, React is rendering correctly.</p>
      <button 
        onClick={() => alert('Button works!')}
        style={{
          padding: '1rem 2rem',
          background: '#7e5a75',
          color: 'white',
          border: 'none',
          borderRadius: '8px',
          cursor: 'pointer'
        }}
      >
        Test Button
      </button>
    </div>
  );
}

export default TestComponent;
